#    rules:                     # 可用length_equal:和length_in_range:定义。大写字母表示字序，小写字母表示其所跟随的大写字母所以表的字中的编码序
#    tail_anchor:               # 造词码包含结构分割符〔仅用于仓颉〕
#    exclude_patterns           # 取消某编码的造词资格
